import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    {title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28)},
    {title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28)},
    {title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28)},
    {title: "Car Insurance", amount: 294.67, date: new Date(2021, 2, 28)},
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses}/>
    </div>
  );
}

export default App;
